def custom_divisible(x, y, z, k):
    """"""
    if x > y:
        return -1
    divisible_numbers = [num for num in range(x, y + 1) if num % z == 0 and num % 2 == 0]
    if k > len(divisible_numbers):
        return -1
    else:
        divisible_numbers.sort(reverse=True)
        return divisible_numbers[k - 1]
